/* eslint-disable */
// @ts-check
'use strict'

const noRestrictedImportPaths = [
  {
    name: '@sanity/ui',
    importNames: [
      'Button',
      'ButtonProps',
      'Dialog',
      'DialogProps',
      'ErrorBoundary',
      'MenuButton',
      'MenuButtonProps',
      'MenuGroup',
      'MenuGroupProps',
      'MenuItem',
      'MenuItemProps',
      'Popover',
      'PopoverProps',
      'Tab',
      'TabProps',
      'Tooltip',
      'TooltipProps',
      'TooltipDelayGroupProvider',
      'TooltipDelayGroupProviderProps',
    ],
    message:
      'Please use the (more opinionated) exported components in sanity/src/ui-components instead.',
  },
  {
    name: 'styled-components',
    importNames: ['default'],
    message: 'Please use `import {styled} from "styled-components"` instead.',
  },
  {
    name: 'react',
    importNames: ['default', 'createContext', 'createElement'],
    message:
      'Please use named imports, e.g. `import {useEffect, useMemo, type ComponentType} from "react"` instead.\nPlease place "context" in _singletons\nPlease use JSX instead of createElement, for example `createElement(Icon)` should be `<Icon />`',
  },
]

const extensions = ['.cjs', '.mjs', '.js', '.jsx', '.ts', '.tsx']

/** @type {import('eslint').Linter.Config} */
const config = {
  root: true,
  env: {
    node: true,
    browser: true,
  },
  extends: [
    'sanity',
    'sanity/react',
    'sanity/import',
    'sanity/typescript',
    'plugin:@typescript-eslint/recommended',
    'plugin:react-hooks/recommended',
    'plugin:react/jsx-runtime',
    'prettier',
    '@sanity/eslint-config-i18n',
    'turbo',
  ],
  parser: '@typescript-eslint/parser',
  plugins: [
    'import',
    'simple-import-sort',
    'unused-imports',
    '@typescript-eslint',
    'prettier',
    'react',
    'react-compiler',
    'tsdoc',
    'unicorn',
  ],
  ignorePatterns: [
    '**/etc/*',
    '**/.sanity/*',
    '**/public/*',
    '**/build/*',
    '**/.next/*',
    '**/static/*',
    '**/coverage/*',
    '**/lib/*',
    '**/node_modules/*',
    '**/dist/*',
    '*.json',
    '*.css',
    '*.snap',
    '*.md',
    'dev/test-studio/sanity.theme.mjs',
    'dev/test-studio/workshop/scopes.js',
  ],
  rules: {
    '@typescript-eslint/no-var-requires': 'off', // prefer import/no-dynamic-require
    'import/extensions': ['error', {pattern: {cjs: 'always', json: 'always'}}],
    'import/named': 'off',
    'import/no-named-as-default': 'off',
    'import/no-named-as-default-member': 'off',
    'import/no-unresolved': 'off',
    'import/default': 'off',
    'prettier/prettier': 'error',
    'tsdoc/syntax': 'error',
    'react-hooks/rules-of-hooks': 'error',
    'react-hooks/exhaustive-deps': 'error',
    // Set react-compiler to `error` once existing issues are fixed
    /**
     * Once all react-compiler warnings are fixed then this rule should be changed to 'error' and:
     * - the `.eslintignore.react-compiler` file should be deleted
     * - the `.github/workflows/are-we-compiled-yet.yml` action can be deleted
     * - the `pnpm check:react-compiler` command removed
     */
    'react-compiler/react-compiler': 'warn',
    'react/no-unescaped-entities': 'off',
    'i18next/no-literal-string': ['error'],
    '@sanity/i18n/no-attribute-string-literals': [
      'error',
      {
        ignores: {
          componentPatterns: ['motion$'],
          attributes: [
            'animate',
            'closed',
            'documentType',
            'exit',
            'fill',
            'full',
            'initial',
            'size',
            'sortOrder',
            'status',
            'group',
          ],
        },
      },
    ],
    '@typescript-eslint/no-explicit-any': ['warn'],
    '@typescript-eslint/no-dupe-class-members': ['error'],
    '@typescript-eslint/no-shadow': ['error'],
    '@typescript-eslint/no-unused-vars': ['warn'],
    '@typescript-eslint/consistent-type-imports': ['error', {prefer: 'type-imports'}],
    'unused-imports/no-unused-imports': 'error',
    'unused-imports/no-unused-vars': ['warn'],
    'import/no-duplicates': ['error', {'prefer-inline': true}],
    'import/first': 'error',
    'import/newline-after-import': 'error',
    'import/consistent-type-specifier-style': ['error', 'prefer-inline'],
    'import/order': 'off', // handled by simple-import-sort
    'sort-imports': 'off', // handled by simple-import-sort
    'simple-import-sort/imports': 'error',
    'simple-import-sort/exports': 'error',
    'no-undef': 'off',
    'no-dupe-class-members': 'off', // doesn't work with TS overrides
    'no-shadow': 'off',
    'no-unused-vars': 'off',
    'no-useless-catch': 'warn',
    'no-async-promise-executor': 'warn',
    'unicorn/prefer-string-slice': 'error',
    'unicorn/prefer-node-protocol': 'error',
    'unicorn/prefer-keyboard-event-key': 'error',
    'unicorn/custom-error-definition': 'error',
  },
  settings: {
    'import/extensions': extensions,
    'import/parsers': {
      '@typescript-eslint/parser': extensions,
    },
    'import/resolver': {
      typescript: {
        alwaysTryTypes: true,
        project: [
          'dev/*/tsconfig.json',
          'examples/*/tsconfig.json',
          'packages/@repo/*/tsconfig.json',
          'packages/@sanity/*/tsconfig.json',
          'packages/*/tsconfig.json',
        ],
      },
    },
    'react': {version: '18.0.0'},
  },
  overrides: [
    // Test files
    {
      files: [`**/*/test/**/*`, '**/*/__tests__/**/*', '**/*.test.{js,ts,tsx}'],
      env: {jest: true},
      rules: {
        'i18next/no-literal-string': 'off',
        '@sanity/i18n/no-attribute-string-literals': 'off',
        '@sanity/i18n/no-attribute-template-literals': 'off',
      },
    },
    // Ignore i18n in ScheduledPublishing files.
    {
      files: ['**/*/scheduledPublishing/**/*'],
      rules: {
        'i18next/no-literal-string': 'off',
        '@sanity/i18n/no-attribute-string-literals': 'off',
        '@sanity/i18n/no-attribute-template-literals': 'off',
      },
    },

    // Files to disable i18n literals,
    {
      files: ['./**/*/__workshop__/**/*', './dev/**/*', './examples/**/*', '**/*/debug/**/*'],
      rules: {
        'i18next/no-literal-string': 'off',
        '@sanity/i18n/no-attribute-string-literals': 'off',
        '@sanity/i18n/no-attribute-template-literals': 'off',
      },
    },

    // Prefer local components vs certain @sanity/ui imports (in sanity package)
    {
      files: ['packages/sanity/**'],
      excludedFiles: [
        '**/__workshop__/**',
        'packages/sanity/src/_singletons/**',
        'packages/sanity/src/_createContext/**',
      ],
      rules: {
        'no-restricted-imports': [
          'error',
          {
            paths: noRestrictedImportPaths,
          },
        ],
      },
    },
    {
      files: ['packages/sanity/src/core/**'],
      excludedFiles: ['**/__workshop__/**'],
      rules: {
        'no-restricted-imports': [
          'error',
          {
            paths: [
              {
                name: 'sanity',
                message:
                  'Please import from a relative path instead (since you are inside `packages/sanity/src/core`).',
              },
              ...noRestrictedImportPaths,
            ],
          },
        ],
      },
    },

    // Prefer top-level type imports in singletons because boundaries plugin doesn't support named typed imports
    {
      files: ['packages/sanity/src/_singletons/**'],
      rules: {
        'import/consistent-type-specifier-style': ['error', 'prefer-top-level'],
      },
    },

    // Don't lint React Compiler rules on test code
    {
      files: [
        `**/*/test/**/*`,
        '**/*/__tests__/**/*',
        '**/*.test.{js,ts,tsx}',
        'packages/sanity/playwright-ct/**',
      ],
      rules: {
        'react-compiler/react-compiler': 'off',
      },
    },
    // Don't lint Turbo undeclared process env variables in code that is used in the CLI at runtime
    {
      files: [
        'packages/@sanity/cli/**',
        'packages/sanity/src/_internal/cli/**',
        'packages/sanity/playwright-ct/**',
      ],
      rules: {
        'turbo/no-undeclared-env-vars': 'off',
      },
    },
  ],
}

module.exports = config

import {defineConfig, type PlaywrightTestConfig} from '@playwright/test'
import {createPlaywrightConfig} from '@sanity/test'

import {loadEnvFiles} from './scripts/utils/loadEnvFiles'
import {readBoolEnv, readEnv} from './test/e2e/helpers/envVars'

loadEnvFiles()

const CI = readBoolEnv('CI', false)
const HEADLESS = readBoolEnv('HEADLESS', true)

/**
 * Excludes the GitHub reporter until https://github.com/microsoft/playwright/issues/19817 is resolved, since it creates a lot of noise in our PRs.
 * @param reporters - The reporters config to exclude the github reporter from
 */
function excludeGithub(reporters: PlaywrightTestConfig['reporter']) {
  if (Array.isArray(reporters)) {
    return reporters.filter((reporterDescription) => reporterDescription[0] !== 'github')
  }
  return reporters === 'github' ? undefined : reporters
}

const playwrightConfig = createPlaywrightConfig({
  projectId: readEnv('SANITY_E2E_PROJECT_ID'),
  token: readEnv('SANITY_E2E_SESSION_TOKEN'),
  playwrightOptions(config): PlaywrightTestConfig {
    const projects = [
      ...(config?.projects?.map((project) => {
        const projectConfig = {
          ...project,
        }

        if (project.name === 'chromium') {
          return {
            ...projectConfig,
            permissions: ['clipboard-read', 'clipboard-write'],
            contextOptions: {
              // chromium-specific permissions
              permissions: ['clipboard-read', 'clipboard-write'],
            },
          }
        }

        if (project.name === 'firefox') {
          return {
            ...projectConfig,
            launchOptions: {
              firefoxUserPrefs: {
                'dom.events.asyncClipboard.readText': true,
                'dom.events.testing.asyncClipboard': true,
              },
            },
          }
        }

        return projectConfig
      }) || []),
    ]

    return {
      ...config,
      reporter: excludeGithub(config.reporter),
      use: {
        ...config.use,
        baseURL: 'http://localhost:3339',
        headless: HEADLESS,
      },
      projects,
      webServer: {
        ...config.webServer,
        command: CI ? 'pnpm e2e:start' : 'pnpm e2e:dev',
        port: 3339,
      },
    }
  },
})

export default defineConfig(playwrightConfig)

{
  // Until what's in dev/, scripts. and test/ is in workspaces it's necessary to type check them from the root
  "extends": "@repo/tsconfig/base.json",
  "include": ["./scripts", "./test"],
  "files": [],
  "compilerOptions": {
    "rootDir": "."
  }
}

{
  "$schema": "https://turbo.build/schema.json",
  // All environment variables that should invalidate a cached build needs to be declared here
  "globalEnv": [
    "CI",
    "GITHUB_ACTIONS",
    "DEBUG",
    "NODE_ENV",
    "PKG_FORMAT",
    "PKG_RUNTIME",
    "PKG_VERSION",
    "SANITY_STUDIO_DATASET",
    "SANITY_STUDIO_DEBUG_I18N",
    "SANITY_STUDIO_DEBUG_TELEMETRY",
    "SANITY_STUDIO_MODE",
    "SANITY_STUDIO_PROJECT_ID",
    "EXTRACT_SANITY_PROJECT_ID",
    "EXTRACT_SANITY_DATASET",
    "EXTRACT_SANITY_API_TOKEN"
  ],
  // Variables that should be passed through but not invalidate the cache
  "globalPassThroughEnv": [
    "PKG_FILE_PATH",
    "RUNNER_OS",
    "SANITY_BASE_PATH",
    "TZ",
    // these is for the perf/efps perf suite and should not be cached
    "VITE_PERF_EFPS_PROJECT_ID",
    "VITE_PERF_EFPS_DATASET",
    "PERF_EFPS_SANITY_TOKEN"
  ],
  "globalDependencies": [
    ".npmrc",
    ".eslintrc.cjs",
    ".prettierrc",
    "lerna.json"
  ],
  "tasks": {
    "build": {
      "outputs": [
        "lib/**",
        "*.js"
      ],
      "dependsOn": [
        "^build"
      ],
      "outputLogs": "new-only"
    },
    "build:bundle": {
      "outputs": [
        "dist/**"
      ],
      "dependsOn": [
        "build"
      ],
      "outputLogs": "new-only"
    },
    "check:types": {
      "outputs": [],
      "dependsOn": [
        "^build"
      ],
      "outputLogs": "errors-only"
    },
    "lint": {
      "outputLogs": "errors-only"
    },
    "//#check:format": {}
  }
}

{
  "version": 2,
  "routes": [
    {
      "handle": "filesystem"
    },
    {
      "src": "/workshop/frame/(.*)",
      "dest": "/workshop/frame/index.html"
    },
    {
      "src": "/preview/(.*)",
      "dest": "/preview/index.html"
    },
    {
      "src": "/(.*)",
      "dest": "/index.html"
    }
  ]
}
